import React from "react";
import { withRouter } from "react-router-dom";

class Header extends React.Component {
    handleHistoryClick = () => {
        this.props.history.push("/history");
    };

    render() {
        return (
            <header>
                <div className="logo-container">
                    <img
                        src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                        alt="AC Milan Logo"
                        className="logo-img"
                    />
                    <span className="logo-text">AC Milan</span>
                    <ul className="nav">
                        <li onClick={this.handleHistoryClick}>Про клуб</li>
                        <li>Основна команда</li>
                        <li>Молодіжна команда</li>
                    </ul>
                </div>
                <div className="presentation"></div>
            </header>
        );
    }
}

export default withRouter(Header);
